<!DOCTYPE html>
<html>
<head>
	<title>Frame Type 2</title>
</head>
<frameset cols="25%,*" noresize="noresize">
	<frame src="Link.html"></frame>
	<frameset rows="*,*,*,*">
		<frameset cols="*,*">
		<frame src="Input.html"></frame>
		<frame src="Output.html"></frame>
		</frameset>
		<frame src="Storage.html"></frame>
		<frameset cols="*,*,*">
			<frame src="Welcome.html"></frame>
			<frame src="home1.html"></frame>
			<frame src="penguin.html"></frame>
		</frameset>
		<frameset cols="*,*">
			<frame src="Output.html"></frame>
			<frameset rows="*,*,*">
				<frame src="Processing.html"></frame>
				<frame src="Input.html"></frame>
				<frame src="Output.html"></frame>
			</frameset>
		</frameset>
	</frameset>
</frameset>
</html>
